function Modal() {
    
    return ( 
        <div className="modal" id="videoModal">
            <div className="modal-content">
                <iframe
                    id="videoPlayer"
                    width="560"
                    height="315"
                    src=""
                    frameborder="0"
                    allowfullscreen
                ></iframe>
                <span className="close" id="closeModal">&times;</span>
            </div>
        </div>
     );
}

export default Modal;
